	/// <returns></returns>
	private async Task UpdateDatabase(int rowId)
	{
		string[] cellContent = new string[7];
		for (int i = 0; i < cellContent.Length; i++)
		{
			cellContent[i] = await runtime.InvokeAsync<string>("getContentFromCell", $"cell{i}_{rowId}");
